script:
// HIDE MARKERS
$("#oslMenu").css("display", "none");
$("#MarkerHighlighters circle").each(function(){
	$(this).css("display", "none");
});
$("#OSL").children("g").css("display", "none");	

// MENU BUTTON
$(document).on("click", "#oslBtn", function(){
